import React, {useState, useContext, useEffect} from 'react';
import Layout from '../components/Layout';
import Navbar from '../components/Navbar-dark';
import UserContext from '../context/UserContext';
import Navbar2 from '../components/Navbar2';
import Topbar from '../components/topbar';
import Footer2 from '../components/Footer2';

const dashboard = props => {
	const { state, isUserAuth } = useContext(UserContext);
	const [isLogin, setIsLogin] = useState('');

	useEffect(() => {
		if(document.getElementsByClassName('nav-list dashboard').length > 0){
			for(let i=0; i<document.getElementsByClassName('nav-list dashboard').length; i++) {
				document.getElementsByClassName('nav-list dashboard')[i].classList.add("active");
			}
		}
	}, []);
	return (
		<>
			<Layout>
				<div className='appear-animate'>
					<Navbar2 />
					<Topbar />
					<div className="banner">
						<div className="row">
							<div className="col-md-4 buyfor">
								<h5>BuyForMe</h5>
							</div>
							<div className="col-md-4 shipyour"></div>
							<div className="col-md-4 description"></div>
						</div>
						<div className="row">
							<div className="col-md-4 uploadpurchase"></div>
							<div className="col-md-4 trackyour"></div>
							<div className="col-md-4 description"></div>
						</div>
					</div>
					<Footer2 />
				</div>
				<style jsx>{`
					div,
					section {
						background: white;
					}
					.banner {
						padding-top: 60px;
						padding-bottom: 50px;
					}
					.banner .col-md-4 {
						padding: 6px 12px;
					}
					.banner .buyfor,
					.banner .shipyour,
					.banner .trackyour,
					.banner .uploadpurchase {
						border-top: 3px solid #1e487c;
					}
					.banner h5 {
						margin: 8px 0px;
					}
				`}</style>
			</Layout>
		</>
	);
};

export default dashboard;
